package ex_08_Switch;

public class Lab0081_switch_interviewquest {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		char ch = 'A';
		switch (ch) {
		
		case 65: 
			System.out.println("Match ASCII");
			break;
			
		default: 
			System.out.println("No Match");
			break;
		}
	}

}
